Описание:
Год - 2020;
Рама - HPA, High Performance Aluminium, Aluminium Lite, AMF, Internal Cable Routing, Easy Mount Kickstand Ready; 
Вилка - SR Suntour XCE, ход: 100 мм; 
Рулевая колонка - Cube FPH863, полуинтегрированная; 
Вынос - Cube Performance Stem; 
Руль - Cube Rise Trail Bar, ширина: 680 мм, диаметр: 31.8 мм;
Грипсы - Cube Performance Grip; 
Задний переключатель - Shimano Tourney TX RD-TX800, 8 скоростей; 
Передний переключатель - Shimano Tourney FD-TY700-TS6, Topswing, диаметр хомута: 31.8 мм, 3 скорости;
Тормозные ручки - Tektro HD-M275; 
Тормоза - Tektro HD-M275, гидравлические дисковые; 
Тормозные диски (роторы) - диаметр: 160 мм; 
Система (шатуны) - Shimano Tourney FC-TY501, 42-34-24T, длина шатунов: 170 мм; 
Цепь - KMC Z8.3, под 8 скоростей; 
Кассета - Shimano Tourney TX CS-HG200-8, 12-32T, 8 скоростей; 
Втулки - Cube Alloy Light, QR, крепление роторов: 6 болтов

